import React from "react";
import Icon from "react-native-vector-icons/AntDesign";
import {
  Feather,
  MaterialCommunityIcons,
  FontAwesome
} from "react-native-vector-icons/";
import {
  Container,
  Header,
  Title,
  BalanceContainer,
  Value,
  Bold,
  HeaderContainer,
  EyeButton,
  Info
} from "./styles";

const Wallet = () => {
  return (
    <Container>
      <Header>
        <HeaderContainer>
          <Title>Saldo PicPay</Title>

          <BalanceContainer>
            <Value>
              R$ <Bold>0,00</Bold>
            </Value>

            <EyeButton>
              <Feather name="eye" size={28} color="#fff" />
            </EyeButton>
          </BalanceContainer>

          <Info>Seu Rendimento está rendendo 100% do CDI</Info>

          <ButtonContainer>
            <Action>
              <MaterialCommunityIcons name="cash" size={20} color="#fff" />
              <Label>Adicionar</Label>
            </Action>

            <Action>
              <MaterialCommunityIcons name="cash" size={20} color="#fff" />
              <Label>Retirar</Label>
            </Action>
          </ButtonContainer>
        </HeaderContainer>
      </Header>
    </Container>
  );
};
Wallet.navigationOptions = {
  tabBarLabel: "Carteira",
  tabBarIcon: ({ tintColor }) => (
    <Icon name="creditcard" size={20} color={tintColor} />
  )
};
export default Wallet;
